pub enum FileEntity {
    Photo {
        #[serde(rename = "type")]
        type_: &'static str,
        media: String,
        #[serde(skip_serializing_if = "Option::is_none")]
        caption: Option<String>,
        #[serde(skip_serializing_if = "Option::is_none")]
        parse_mode: Option<String>,
    },
    Video {
    },
}

pub enum File {
    Memory {
        name: String,
        source: Box<Read + Send>,
    },
    Disk {
        path: PathBuf,
    },
    Telegram(String),
    Url(String),
}
